class WRAPPER {
public TaskView getTaskFromFullPath(String fullTaskName) {
        if (projects.isEmpty()) {
            return null;
        }// we haven't loaded yet

        PathParserPortion pathParserPortion = new PathParserPortion(fullTaskName);
        if (pathParserPortion.getFirstPart() == null) {
            return null;
        }
        String remainder = pathParserPortion.getRemainder();
        ProjectView rootProject = null;
        // this means it starts with a colon, just get the root
        if (pathParserPortion.getFirstPart().equals("")) {
            if (!projects.isEmpty()) {
                rootProject = projects.get(0);
            }
        } else {
            // see if they did specify the root.
            rootProject = getRootLevelProject(pathParserPortion.getFirstPart());
            // if the root wasn't specified, just go get the first item we have. root' isn't typically specified if a user gives us the path.
            if (rootProject == null) {
                if (!projects.isEmpty()) {
                    rootProject = projects.get(0);
                    remainder = fullTaskName;
                }
            }
        }
        // we found a match. We only want whatever's left
        if (rootProject != null) {
            return rootProject.getTaskFromFullPath(remainder);
        }
        // we don't have a full path.
        return null;
    }
}

class WRAPPER {
public Object methodMissing(String name, Object args) {
        Object[] argsArray = ((Object[]) (args));
        Configuration configuration = configurationContainer.findByName(name);
        if (configuration == null) {
            throw new MissingMethodException(name, this.getClass(), argsArray);
        }
        List<?> normalizedArgs = CollectionUtils.flattenCollections(argsArray);
        if ((normalizedArgs.size() == 2) && (normalizedArgs.get(1) instanceof Closure)) {
            return doAdd(configuration, normalizedArgs.get(0), ((Closure) (normalizedArgs.get(1))));
        } else if (normalizedArgs.size() == 1) {
            return doAdd(configuration, normalizedArgs.get(0), null);
        } else {
            for (Object arg : normalizedArgs) {
                doAdd(configuration, arg, null);
            }
            return null;
        }
    }
}
